import React from 'react'

function Home() {
  return (
    <section>
      <h1>Vi gör livet lättare för nya mammor</h1>
      <h3>Ge din kropp näring och vila efter förlossning. 
        Matlådorleverans för nyblivna mammor och föräldrar</h3>
    </section>
  )
}

export default Home
